import React from 'react';
import { Carousel } from 'react-bootstrap';

function QuranCarousel() {
  return (
    <Carousel>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src="https://egthad.com/wp-content/uploads/2022/07/%D8%A7%D9%84%D8%B1%D8%A6%D9%8A%D8%B3%D9%8A%D8%A9-_-%D8%A3%D9%83%D8%A7%D8%AF%D9%8A%D9%85%D9%8A%D8%A9-%D8%A7%D9%84%D8%B1%D9%8A%D8%A7%D9%86-1024x379.png"
          alt="Third slide"
        />
      </Carousel.Item>
    </Carousel>
  );
}
export default QuranCarousel;
